import { Route, Routes } from 'react-router-dom'
import App from '../App'
import PushImage from '../pages/PushImage'

function Stack() {
  return (
    <Routes>
      <Route path="/" element={<App />} />
      <Route path="/PushImage" element={<PushImage />} />
    </Routes>
  )
}

export default Stack
